import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>Weather App</h1>
      <footer>
        This is{" "}
        <a
          href="https://github.com/jnasmbrd/react-weatherapp-finalproject.git"
          target="_blank"
        >
          open source code
        </a>{" "}
        by <a href="">Janice Asumbrado.</a>
      </footer>
    </div>
  );
}

export default App;
